import React, { useState, useEffect } from "react";
import TaskBoard from "./components/TaskBoard";
import ContactBoard from "./components/ContactBoard";

function App() {
  const [token, setToken] = useState(localStorage.getItem("token") || "");
  const [user, setUser] = useState(null);
  const [screen, setScreen] = useState(token ? "dashboard" : "login");

  // -- Vérifie token valide au chargement --
  useEffect(() => {
    if (token) {
      fetch("http://localhost:4000/me", {
        headers: { Authorization: "Bearer " + token },
      })
        .then((r) => r.ok ? r.json() : Promise.reject())
        .then((u) => {
          setUser(u);
          setScreen("dashboard");
        })
        .catch(() => {
          setToken("");
          localStorage.removeItem("token");
          setScreen("login");
        });
    }
  }, [token]);

  // -- Auth: Register/Login form --
  async function handleAuth(e, mode) {
    e.preventDefault();
    const username = e.target.username.value;
    const password = e.target.password.value;
    const res = await fetch(`http://localhost:4000/${mode}`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ username, password }),
    });
    if (mode === "login" && res.ok) {
      const { token } = await res.json();
      setToken(token);
      localStorage.setItem("token", token);
      setScreen("dashboard");
    } else if (mode === "register" && res.ok) {
      alert("Inscription réussie, connectez-vous !");
      setScreen("login");
    } else {
      alert("Erreur : " + (await res.json()).error);
    }
  }

  function logout() {
    setToken("");
    setUser(null);
    localStorage.removeItem("token");
    setScreen("login");
  }

  if (screen === "login")
    return (
      <div style={{ margin: 40 }}>
        <h2>Connexion</h2>
        <form onSubmit={(e) => handleAuth(e, "login")}>
          <input name="username" placeholder="Nom d'utilisateur" required /><br />
          <input name="password" type="password" placeholder="Mot de passe" required /><br />
          <button>Connexion</button>
        </form>
        <button onClick={() => setScreen("register")}>Créer un compte</button>
      </div>
    );
  if (screen === "register")
    return (
      <div style={{ margin: 40 }}>
        <h2>Inscription</h2>
        <form onSubmit={(e) => handleAuth(e, "register")}>
          <input name="username" placeholder="Nom d'utilisateur" required /><br />
          <input name="password" type="password" placeholder="Mot de passe" required /><br />
          <button>S'inscrire</button>
        </form>
        <button onClick={() => setScreen("login")}>Déjà un compte ?</button>
      </div>
    );

  // --- DASHBOARD ---
  return (
    <div style={{ margin: 40 }}>
      <h2>Dashboard collaboratif</h2>
      <div>Connecté en tant que : <b>{user?.username}</b>
        <button onClick={logout} style={{ marginLeft: 12 }}>Déconnexion</button>
      </div>
      <hr />
      <TaskBoard token={token} />
      <ContactBoard token={token} />
    </div>
  );
}

export default App;
